package com.example.sopt.fragment

import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import com.example.Sopt.R
import com.example.sopt.main.InstaAdapter
import com.example.sopt.data.InstaData
import kotlinx.android.synthetic.main.fragment_home.*

/**
 * A simple [Fragment] subclass.
 */
class HomeFragment : Fragment() {

    lateinit var instaAdapter: InstaAdapter
    val datas = mutableListOf<InstaData>()
    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        return inflater.inflate(R.layout.fragment_home, container, false)
    }


    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        instaAdapter = InstaAdapter(view.context)
        rv_home.adapter  = instaAdapter //리사이클러뷰의 어댑터를 instaAdapter로 지정해줌
        laodDatas() //데이터를 임의로 생성하고 어댑터에 전달
    }

    private fun laodDatas(){
        datas.apply {
            add(
                InstaData(
                    username = "김기현",
                    img_profile = "data:image/jpeg;base64,",
                    img_contents = "data:image/png;base64,"
                ))
            add(
                InstaData(
                    username = "안드로이드",
                    img_profile = "data:image/jpeg;base64,",
                    img_contents = "data:image/jpeg;base64,"
                ))
            add(
                InstaData(
                    username = "YB",
                    img_profile = "data:image/jpeg;base64,",
                    img_contents = "data:image/jpeg;base64,"
                ))
        }
        instaAdapter.datas = datas
        instaAdapter.notifyDataSetChanged()
    }
}